          break;
        case 'array':
          errorMessage = `${variableName} must be an array of strings`;
          break;
        default:
          errorMessage = 'Invalid type';
      }
    }

    if (type === 'array') {
      if (!Array.isArray(value) || !value.every((item) => typeof item === 'string')) {
        throw new TypeError(errorMessage);
      }
